Dashmix.onLoad((() => class { 
    static initValidation() { 
        Dashmix.helpers("jq-validation"), 
        jQuery(".js-validation-signin").validate({ 
            rules: { 
                "login-email": { 
                    required: !0, minlength: 5 
                }, 
                "login-password": { 
                    required: !0, minlength: 6 
                } 
            }, 
            messages: 
            { 
                "login-email": { 
                    required: "Silahkan masukan email", 
                    minlength: "Email minimal 5 karakter" 
                }, 
                "login-password": { 
                    required: "Silahkan masukan pasword", 
                    minlength: "Password minimal 5 karakter" 
                } 
            } 
        }) 
    } 
    static init() { 
        this.initValidation() 
    } 
}.init()));